import React from 'react';
import ReactDOM from 'react-dom/client';
import './index.css';
import App from './App.js';
import reportWebVitals from './reportWebVitals.js';

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
    <Router>

      <Navbar />

      <Routes>
        <Route exact path="/warmups" component={ <Warmups/> } />
        <Route path="/react" component={ <ReactPage /> } />
        <Route path="/css" component={ <CssPage />} />
        <Route path="/" component={ <Home/> } />
      </Routes>

    </Router>
  </React.StrictMode>
);

function Navbar() {
  return (
  <nav>
    <h2>Byte Sized Web</h2>
    <ul>
        <li><Link to="/">Home</Link></li>
        <li><Link to="/warmups">Warm ups</Link></li>
        <li><Link to="./pages/react.js">React</Link></li>
        <li><Link to="./pages/css.js">CSS</Link></li>
    </ul>
  </nav>
  )
  }
// If you want to start measuring performance in your app, pass a function
// to log results (for example: reportWebVitals(console.log))
// or send to an analytics endpoint. Learn more: https://bit.ly/CRA-vitals
reportWebVitals();
